basis: Warsaw
metadata: 
  description: Warsaw basis augmented by Sterile neutrinos (2411.07220). The Wilson coefficients are defined to be dimensionful, such that $\\mathcal L=\\sum _i C_i$ O_i$. The weak basis for the fermion fields is chosen such that the running dimension-6 mass matrices of charged leptons and down-type quarks are diagonal at the scale where the coefficient values are specified, while the up-type quark singlet field is rotated to diagonalize the running dimension-6 up-type quark mass matrix \ from the right\.\n
